INSERT INTO `garbage_type` VALUES (1, '废纸张、废塑料、废玻璃制品、废金属、废织物等适宜回收、可循环利用的生活废弃物', '酱油瓶、玻璃瓶、平板玻璃、易拉罐、饮料瓶、洗发水瓶、塑料玩具、书本、报纸、广告单、纸板箱、衣服、床上用品等', '轻投轻放\n清洁干燥，避免污染，费纸尽量平整\n立体包装物请清空内容物，清洁后压扁投放\n有尖锐边角的、应包裹后投放', '可回收垃圾', '2020-05-01 17:28:02');
INSERT INTO `garbage_type` VALUES (2, '即其他垃圾，是指除可回收物、有害垃圾、湿垃圾以外的其它生活废弃物', '餐盒、餐巾纸、湿纸巾、卫生间用纸、塑料袋、食品包装袋、污染严重的纸、烟蒂、纸尿裤、一次性杯子、大骨头、贝壳、花盆、陶瓷等', '尽量沥干水分\n难以辨识类别的生活垃圾投入干垃圾容器内', '干垃圾', '2020-05-01 17:28:52');
INSERT INTO `garbage_type` VALUES (3, '日常生活垃圾产生的容易腐烂的生物质废弃物', '剩菜剩饭、瓜皮果核、花芬绿植、过期食品等', '纯流质的食物垃圾、如牛奶等，应直接倒进下水口\n有包装物的湿垃圾应将包装物去除后分类投放、包装物请投放到对应的可回收物或干垃圾容器', '湿垃圾', '2020-05-01 17:29:41');
INSERT INTO `garbage_type` VALUES (4, '废电池、废灯管、废药品、废油漆及其容器等对人体健康或者自然环境造成直接或者潜在危害的生活废弃物', '废电池、油漆桶、荧光灯管、废药品及其包装物等', '投放时请注意轻放\n易破损的请连带包装或包裹后轻放\n如易挥发，请密封后投放', '有害垃圾', '2020-05-01 17:30:14');
INSERT INTO `notice` VALUES (1, '<p>请填写文字内容</p>', 6, '2020-05-01 17:05:13', 'dd');
INSERT INTO `notice` VALUES (2, '<p>啦啦啦啦啦</p>', 0, '2020-05-02 18:09:18', '北京');
INSERT INTO `notice` VALUES (3, '<p>&nbsp; &nbsp; &nbsp; &nbsp;据悉，新版条例规定，生活垃圾分为四类，即厨余垃圾、可回收物、有害垃圾以及其他垃圾。党政机关、企业事业单位、社会团体等单位的办公或者生产经营场所应当根据需要设置厨余垃圾、可回收物、有害垃圾、其他垃圾四类收集容器；住宅小区和自然村应当在公共区域成组设置厨余垃圾、其他垃圾两类收集容器，并至少在一处生活垃圾交投点设置可回收物、有害垃圾收集容器。</p>', 5, '2020-05-02 18:10:42', '北京垃圾分类首日实施');
INSERT INTO `notice` VALUES (5, '<p>请填写文字内容</p>', 2, '2020-05-06 14:40:55', '钱王拳王q');
INSERT INTO `notice` VALUES (7, '<p>北京开展垃圾分类现场督查</p>\n\n<p>　　针对发现的九类问题 张家明副市长提出4点要求</p>\n\n<p>　　为推进新修订的《北京市生活垃圾管理条例》落实，5月4日，北京市生活垃圾分类推进工作指挥部开展首次现场督导检查。北京市城市管理委联合市住建委、市民政局、市城管执法局等多部门，兵分六路对城六区及昌平区等进行突击检查。与此同时，各区还开展了自查，市城市管理委组织机关干部开展暗访摸底。张家明副市长带队督查并提出具体要求。据介绍，各区将针对检查中发现的问题逐一落实整改。</p>\n\n<p>　　据了解，督导检查组现场重点查看生活垃圾分类宣传动员情况、小区桶站设置情况、人员指导情况、桶站周边卫生情况、垃圾处理设施运行情况、查看小区物业责任落实情况等。</p>\n\n<p>　　总的来看，大部分小区垃圾分类工作推进有序，设施总体运行良好， 但也存在许多不足和问题。检查中共梳理出九类问题，分别是桶站设置不规范;垃圾桶不洁、标识损坏，标识更新不到位;厨余垃圾分类质量差;指导员不足;垃圾清运不及时;大件家具暂存和回收点位未到位;部分小区未设置宣传海报或条幅;宾馆仍存在提供一次性用品的情况;餐饮企业对落实光盘行动的告知不充分。</p>\n\n<p>　　除了市级督导检查外，昨天各区还开展了自查，对90个社区、162家社会单位垃圾分类情况进行检查。同时，市城市管理委组织机关干部四级调研员(含以上人员)共163人，遵照就地就便的原则对自己居住小区垃圾分类情况暗访摸底。</p>\n\n<p>　　据了解，此次检查中发现的具体点位上的问题，将由各区逐一落实整改。针对昨天发现的问题，市城市管委主任孙新军介绍，仅5月1日一天，全市就开出约200张整改通知单，有的区一天就开出几十张整改通知单。&ldquo;针对垃圾分类不符合要求的情况，目前以劝导为主，随着垃圾分类的持续深入，如还有单位在执行过程中不符合规定，将受到处罚。&rdquo;</p>', 4, '2020-05-06 18:15:20', '垃圾分类6大问题');
